import React from "react";
import { Text, StyleSheet } from "react-native";
import ComponentsScreen from './ComponentsScreen'

const HomeScreen = () => {
  return (
    <>
      <Text style={styles.text}>Hi There!</Text>
      <ComponentsScreen />
    </>
  );
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30
  }
});

export default HomeScreen;
